import MyAccount from './MyAccount'; // Import MyAccount component
import MyListings from './MyListings'; // Import MyListings component
import './Profile.css'; // Import CSS for styling the sidebar

const Profile = () => {
  return (
    <div className="container">
      <div className="sidebar">
        <ul>
          <li><MyAccount /></li>
          <li><MyListings /></li>
        </ul>
      </div>
      <div className="content">
        {/* Content of the page */}
      </div>
    </div>
  );
}

export default Profile;
